  "advertisements": [
    {
      "date": null,
      "tags_section": null,
      "text": "Kaissers ist die Bewohnung auf dem ersten Stock zu verleihen, bestehend in 3 Stuben, Kuchin, Kammern, Sommerhaus, Keller 2c. nach Belieben zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "1. Es sucht jemand einen silbern Schreibzeug mit aller Zugehördt und schöner Faßon, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "2. Man begehrt eine Chaise mit 4 Rädern zu etwann 2 Pläzen und zu einem Pferd samt gehörigem Geschirr, der Liebhaber ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "3. Wer hier oder auf dem Land noch neuen Träber-Brandtewein Ohmenweis zu verkauffen hat, kan im Berichthaus einen Käuffer darzu vernehmen, wie auch zu einem mittelmäsigen Sponton, so ebenfahls begehrt wird, beydes ohne Entgeldt im Berichthaus ist zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "4. Es sucht jemand eine gute, solide und ungefehr einen Saum haltende Feuersprizen zum tragen oder zum führen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "5. Es sucht jemand einen mösinginen Kron-Leuchter mit 8 Lichtstöcken, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "6. Es verlangt jemand eine nicht gar grosse eiserne Geld-Cassa zu kauffen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "7. Es verlangt jemand einen glatten nußbaumern zweythürigen Kasten, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kauffen begehrt:",
      "text": "8. Man verlangt einen noch guten Kachel-Ofen mittelmäsiger Grösse mit oder ohne Fuß, der Liebhaber ist im Berichthaus zu erfragen; leidet aber keinen Verzug."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "1. Ein Losament mitten im Offenburger-hof, wie der Augenschein zeigen wird, auf nächste Faßnacht, oder Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "2. Ein sauberes Losament an der Spalen von einer Stuben und Nebenkammer, oder nach Belieben zwo Kammern samt einem heitern Sommerhaus, alles auf einem Boden, und nach Belieben Stallung und Heubühne, auf Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "3. Ein Losament mit einem schönen Laden und Laden-Stüblein nebst einem grossen Sommershaus, Stuben, Kuchin, 2 grosse Kammern, einem besondern Keller, Holtzhaus, ein beschlossenes Bauchhaus, auf der Eisengaß, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "4. Ein Losament in der Fröschgaß von einer Stuben, 2 Kammern und Plaz zum Holtz, auf Pfingst-Fronfasten zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "5. Ein Losament für 2 Personen in der Weissen-Gaß, bestehend aus einem Stüblein und Alleskofen, Plaz zum hausrath zu stellen, auf einem Boden, wie auch Plaz zum holtz, Brunsnen un haus, à 15 Pfund Zins des Jahrs, kan gleich bezogen werden, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "6. Ein schönes Losament ebenes Fusses auf einem Boden von 2 Stuben, einem grossen Saal, Kammern, Kuchin, Keller, Plaz zum holtz, Zutritt zum Bauchhaus, und so beliebig, einem Garten in der Aeschener Vorstadt, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "7. Eine grosse doppelte Frucht-Schütte auf E. E. Geselschafft zum hohen Rupf."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "8. Bis den 1sten diß wird eine säugende hündin begehrt, um etliche junge hunde zu auferziehen, gegen einer Erkenntlichkeit; wo sich anzumelden, ist im Berichthaus ohne Entgeldt zu vernehmen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "9. Auf künftige Weyhnacht ist unter der St. Peters-Schul ein geräumiges Magazin zu verleihen, darum sich in dem Schulhaus anzumelden."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "text": "1. In ein wackeres protestantisches hauß in denen Niederlanden wird ein Candidatus Theologiæ, der neben andern auch die französische Sprach verstünde, zu einem haus-Præceptor begehrt, weshalb sich im Berichthaus zu melden."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "text": "2. Man verlangt einen Menschen in eine Fabricke, der sich zu allerley haus-Geschäften brauchen liesse, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "text": "3. Man sucht einen Stallknecht in ein Wirthshaus, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "text": "4. Ein"
    }
  ]
}

